import React from "react";
import Layout from "../components/layout";
import Seo from "../components/seo";
import { fetchAPI } from "../lib/api";

const Home = ({ homepage }) => {
  return (
    <Layout>
      <Seo seo={homepage.seo} />
      <div className="uk-section">
        <div className="uk-container uk-container-large">
          <div>
            <h1 className="uk-heading-medium">
              Olá, eu sou Rafael,
              <br /> desenvolvedor de software fullstack.
            </h1>
            <h4 class="uk-heading-bullet">
              <span>
                Bem vindo a minha página pessoal, aqui você pode encontrar
                algumas coisinhas que eu escrevo, tutoriais, e trabalhos
                realizados.
              </span>
            </h4>
          </div>
        </div>
      </div>
    </Layout>
  );
};

export async function getStaticProps() {
  // Run API calls in parallel
  const [homepage] = await Promise.all([fetchAPI("/homepage")]);

  return {
    props: { homepage },
    revalidate: 1,
  };
}

export default Home;
